import React, {Component} from 'react';
import {Card, CardHeader, CardText, CardActions} from 'material-ui/Card';
import * as InstrumentenService from '../Services/InstrumentService.js'
import {List, ListItem} from 'material-ui/List';
import {black500, deepOrangeA700, grey500} from 'material-ui/styles/colors';
import TextField from 'material-ui/TextField';
import FlatButton from 'material-ui/FlatButton';


const styles = {
    width: {
        width: "90%",
    },
    loginButton: {
        boxShadow: "2px 2px 5px #616161",
        margin: 12,
    },
    errorStyle: {
        color: deepOrangeA700,

    },
    underlineStyle: {
        borderColor: deepOrangeA700,
    },
    inputstyle: {
        color: black500,
    },
    floatingLabelStyle: {
        color: black500,
    },
    floatingLabelFocusStyle: {
        color: grey500,
    },
    exampleImageInput: {
        cursor: 'pointer',
        position: 'absolute',
        top: 0,
        bottom: 0,
        right: 0,
        left: 0,
        width: '100%',
        opacity: 0,
    },
};


class InstrumentDetails extends Component {

    constructor(props) {
        super(props);
        this.state = {
            instrument: {
                instrumentId: 1,
                type: "string",
                soort: {
                    instrumentSoortId: 1
                },
                afbeelding: "string",
                naam: "string",
                uitvoering: "string",
            }
            ,
            open: false,
        }
    }

    componentDidMount() {
        InstrumentenService.getInstrumentFromBackend(this.props.id)

            .then(console.log("----Instrument met id " + this.props.id + "---- \n"))
            .then(instrument => this.setState({instrument: instrument}, console.log(instrument)))
    }

    onChangeType = (event, typedType) => {
        let instrument = Object.assign({}, this.state.instrument);
        instrument.type = typedType;
        this.setState({instrument});
        console.log("Type:" + this.state.instrument.type)
    };

    handleUpdate = () => {
        var self = this;
        InstrumentenService.UpdateInstrument(self.state.instrument.instrumentId, JSON.stringify(
            {
                afbeelding: "",
                instrumentsoortid: self.state.instrument.soort.instrumentSoortId,
                naam: self.state.instrument.naam,
                type: self.state.instrument.type,
                uitvoering: self.state.instrument.uitvoering
            }
        ));
        console.log("instrumentId: " + self.state.instrument.instrumentId);
        console.log("Image: " + self.state.instrument.afbeelding);
        console.log("instrumentSoortId: " + self.state.instrument.soort.instrumentSoortId);
        console.log("Name: " + self.state.instrument.naam);
        console.log("Type: " + self.state.instrument.type);
        console.log("Version: " + self.state.instrument.uitvoering);
    };

    render() {
        return (
            <div >

                <h1 className="header">Details</h1>
                <Card expanded={true}>
                    <CardHeader
                        title={this.state.instrument.naam}
                    />
                    <CardText>
                        <div className="InstrumentDetail">
                            <div id="instrumentDetails">
                                <List>
                                    <ListItem>
                                        <TextField
                                            onChange={this.onChangeType}
                                            hintText="Geef nieuw type in..."
                                            floatingLabelText="Type"
                                            style={styles.width}
                                            inputStyle={styles.inputstyle}
                                            hintStyle={styles.floatingLabelFocusStyle}
                                            floatingLabelStyle={styles.floatingLabelStyle}
                                            floatingLabelFocusStyle={styles.floatingLabelFocusStyle}
                                            underlineFocusStyle={styles.underlineStyle}
                                        />
                                    </ListItem>
                                </List>
                            </div>
                        </div>
                    </CardText>
                    <CardActions>
                        <FlatButton label="Update" onClick={this.handleUpdate}/>
                    </CardActions>
                </Card>
            </div>
        );
    }
}

export default InstrumentDetails;
